function search(searchString) {
	var finds = [],
		fileFragments = lively.ide.startSourceControl().allModules().invoke('ast');
	fileFragments.forEach(function(ff) {
		finds.pushAll(ff.flattened().select(function(ea) {
			return ea.getSourceCode().include(searchString)
		}))
	})
	var items = finds.collect(function(ea) {
		return {
			isListItem: true,
			value: ea,
			string: ea.name + '(' + ea.type + ',' + ea.fileName + ')',
		}
	})
	this.get('searchResultList').updateList(items);
}
